import { Cell } from "./Cell";
import { GameObject } from "./GameObject";


export class snake extends GameObject{
    constructor(info, gamemap){
        super();

        this.id = info.id;
        this.color = info.color;
        this.gamemap = gamemap;


        this.cells = [new Cell(info.r, info.c)]
    }
}
